import Layout from '../components/Layout';
import Logout from '../components/Logout';
import Authentication from '../components/Authentication';

const Dashboard = () =>  

(
    <Layout>
        <div>
            <h1>My Dashboard</h1>


            <Logout></Logout>



            <Authentication></Authentication>        
        </div>
    </Layout>

);



export default Dashboard;
